window.bookSummaryJSON = "<p>Nyssa Glass is a reformed cat burglar turned electrician's apprentice, settled into a life repairing videophones and radio-sets. However, when her past comes calling, she finds herself forced into one last job. No one has entered Professor Dalhart's secluded mansion in almost a decade, at least not and returned to tell the tale. If Nyssa wants to ensure her freedom, she'll brave the booby trapped halls and mechanized maids.&nbsp;</p> <p>Nyssa has skills, but this house has more than its share of secrets. As she steps into the cobwebbed halls lined with dusty mirrors, she has to wonder. Is the House of Mirrors really abandoned?</p>"; 
